<script>
    import Vivus from 'vivus';
    let isMicrosite = process.env.STANDALONE.toString() == 'true';
    
    document.addEventListener('DOMContentLoaded', function(event) {
        let titleWrap = document.querySelector('.title');
        let svgs = document.querySelectorAll('.title');
        let subtitle = document.querySelector('.subtitle');
        let subtitlePaths = subtitle ? subtitle.querySelectorAll('path') : null;
        let mobileTitle = document.querySelector('.mobile-title-wrap');
        let menuItem4 = document.querySelector('.menu-item-4');
        let author = titleWrap.querySelector('.test');
        
        svgs.forEach((svg, i) => {
            new Vivus(svg, {type: 'oneByOne', delay: 150, duration: 200 }, () => {});
        });
        
        const positionSubtitle = () => {
            if (isMicrosite) return;
            let offsetMenuEl = menuItem4.getBoundingClientRect();
            let offsetTitle = titleWrap.getBoundingClientRect();
            let offsetAuthor = author.getBoundingClientRect();
            let leftMenuEl = offsetMenuEl.left;
            let leftTitle = offsetTitle.left;
            let topAuthor = offsetAuthor.top;
            subtitle.style.top = `${ topAuthor }px`;
            subtitle.style.left = `${ leftMenuEl - leftTitle }px`;
        }

        positionSubtitle();
        window.onresize = positionSubtitle;

        svgs.forEach((svg, i) => {
            new Vivus(svg, {type: 'oneByOne', delay: 150,  duration: 200 }, () => {});
        });

        if (subtitlePaths) {
            subtitlePaths.forEach((path, i) => {
                setTimeout(() => {
                    path.style.opacity = 1;
                }, 100 * i + 1800);
            });
        }

        if (!isMicrosite) return;
        
        setTimeout(() => {
            mobileTitle.style.opacity = 1;
        }, 200);
    });
</script>

<style lang="scss">

    .title-wrap {
        position: relative;
    }

    :global(.microsite .title-wrap) {
        // Mobile menu should appear
        @media only screen and (max-width: 500px) {
            display: none;
        }
    }

    :global(.microsite .mobile-title-wrap) {
        // Mobile menu title
        @media only screen and (max-width: 500px) {
            display: block !important;
            margin-top: 2vh;
        }
    }

    .title {
        width: 73vw;
        top: 12vh;
        position: absolute;
        margin-left: -18.4vw;
        opacity: 0;
        transition: opacity 2s ease;
        overflow: visible;
        z-index: 20;

        @media (min-aspect-ratio: 80/43) {
            top: 2vw;
        }
    }

    .subtitle {
        width: 23vw;
        top: 16.36vh;
        left: 62vw;
        transform: translateY(-52%);
        position: absolute;
        margin-left: -18.4vw;
        transition: opacity 2s ease;
        overflow: visible;
        z-index: 20;

        path {
            opacity: 0.01;
        }

        @media (min-aspect-ratio: 80/43) {
            top: 2vw;
        }
    }

    :global(.microsite .title) {
        margin-left: -18vw;
    }

    path,
    .line {
        transition: 2.2s ease;
    }

    .line-horizontal {
        fill:none;
        stroke:#000000;
        opacity: 0;
    }

    .line-dash {
        fill:none;
        stroke:#000000;
    }

    .mobile-title-wrap {
        width: 100vw;
        opacity: 0;
        display: none;
        transition: 2.2s ease;
    }
</style>
  
